// Funções auxiliares atualizadas para um visual mais minimalista
func getStatusColorClass(status string) string {
	switch status {
	case "active":
		return "bg-green-100 text-green-800 dark:bg-green-900/30 dark:text-green-400"
	case "new":
		return "bg-blue-100 text-blue-800 dark:bg-blue-900/30 dark:text-blue-400"
	case "completed":
		return "bg-purple-100 text-purple-800 dark:bg-purple-900/30 dark:text-purple-400"
	default:
		return "bg-gray-100 text-gray-800 dark:bg-gray-800 dark:text-gray-400"
	}
}

func getStatusText(status string) string {
	switch status {
	case "active":
		return "Ativo"
	case "new":
		return "Novo"
	case "completed":
		return "Concluído"
	default:
		return status
	}
}

func getCategoryColorClass(category string) string {
	switch category {
	case "Meio Ambiente":
		return "bg-green-100 text-green-800 dark:bg-green-900/30 dark:text-green-400"
	case "Educação":
		return "bg-blue-100 text-blue-800 dark:bg-blue-900/30 dark:text-blue-400"
	case "Saúde":
		return "bg-red-100 text-red-800 dark:bg-red-900/30 dark:text-red-400"
	case "Tecnologia":
		return "bg-purple-100 text-purple-800 dark:bg-purple-900/30 dark:text-purple-400"
	case "Cultura":
		return "bg-yellow-100 text-yellow-800 dark:bg-yellow-900/30 dark:text-yellow-400"
	default:
		return "bg-gray-100 text-gray-800 dark:bg-gray-800 dark:text-gray-400"
	}
}

func getProgressColorClass(progress int) string {
	if progress >= 75 {
		return "text-green-600 dark:text-green-400"
	} else if progress >= 50 {
		return "text-blue-600 dark:text-blue-400"
	} else if progress >= 25 {
		return "text-orange-600 dark:text-orange-400"
	}
	return "text-red-600 dark:text-red-400"
}

func getProgressBarColorClass(progress int) string {
	if progress >= 75 {
		return "bg-green-500"
	} else if progress >= 50 {
		return "bg-blue-500"
	} else if progress >= 25 {
		return "bg-orange-500"
	}
	return "bg-red-500"
}

// Ícones mantidos os mesmos
func getProjectIcon(category string) string {
	switch category {
	case "Meio Ambiente":
		return "🌱"
	case "Educação":
		return "📚"
	case "Saúde":
		return "🏥"
	case "Tecnologia":
		return "💻"
	case "Cultura":
		return "🎭"
	default:
		return "🌟"
	}
}

